      SELECT DISTINCT - col1 * col2 AS col2 FROM tab1 (FORMAT parquet) WHERE ( 91 * + ( - 42 / col0 ) ) IS NOT NULL;
  - name: tab1

outputs:
  - name: q7549.out
    data: |
      -1344
      -295
      -3196
